import React from "react";
import { Link } from "react-router-dom";

const Dashboard = ({ match }) => {
  return (
    <div>
      <h1>Admin Dashboard</h1>
      <ul>
        <li>
          <Link to="/admin/posts" />
        </li>
        <li>
          <Link to="/admin/users" />
        </li>
      </ul>
    </div>
  );
};

export default Dashboard;
